#include <iostream>
#include <string>
#include <vector>


using std::string;
using std::vector;

class Solution {
public:
    string addSpaces(string s, vector<int>& spaces) {

        if (spaces.empty()) {return s;}
        if (s.size() > 300000){ return "Error";}
        string v_spaces;
        int j = 0;
        int i = 0;
        while (j < spaces.size() || spaces[j] == s.size())
        {
          if (j == 0){
            v_spaces.append(s, i, spaces[j]);
            v_spaces.append(" ");
            i = spaces[j];
            ++j;
          }
          else {
          v_spaces.append(s, i, spaces[j]-spaces[j-1]);
          v_spaces.append(" ");
          i = spaces[j];
          ++j;
          }
        
        std::cout<<v_spaces<<std::endl;      
        }
        v_spaces.append(s, spaces[j-1]);
        v_spaces.push_back('\0');
        return v_spaces;
    }
};

